CREATE TABLE sys.syspermissions
(
    id int NOT NULL,
    grantee smallint,
    grantor smallint,
    actadd smallint,
    actmod smallint,
    seladd varbinary(4000),
    selmod varbinary(4000),
    updadd varbinary(4000),
    updmod varbinary(4000),
    refadd varbinary(4000),
    refmod varbinary(4000)
);
